const API_URL = process.env.REACT_APP_API_URL;

export async function getParticipantes() {
    const response = await fetch(`${API_URL}/participantes/`);
    return response.json();
}

export async function getTreinamentos() {
    const response = await fetch(`${API_URL}/treinamentos/`);
    return response.json();
}

export async function getCertificados() {
    const response = await fetch(`${API_URL}/certificados/`);
    return response.json();
}
